import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

function AdminConnexionPannel() {
  const [email, setEmail] = useState(''); // État pour l'email
  const [password, setPassword] = useState(''); // État pour le mot de passe


  return (
    <Form onSubmit={handleSubmit}> {/* Ajout de l'événement onSubmit ici */}
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Email address</Form.Label>
        <Form.Control
          type="email"
          placeholder="Enter email"
          value={email}
          onChange={(e) => setEmail(e.target.value)} // Mettre à jour l'état de l'email
        />
        <Form.Text className="text-muted">
          We'll never share your email with anyone else.
        </Form.Text>
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>Password</Form.Label>
        <Form.Control
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)} // Mettre à jour l'état du mot de passe
        />
      </Form.Group>
      <Button variant="primary" type="submit" on> {/* Le type doit être "submit" pour soumettre le formulaire */}
        Submit
      </Button>
    </Form>
  );
}

export default AdminConnexionPannel;
